package bean;

public class menuBean {

	public menuBean() {
		// TODO Auto-generated constructor stub
	}
	
	private String[] bean_title = {};
	private String[] bean_time = {};
	private int bean_flag = 0;
	
	public String[] getBean_title() {
		return bean_title;
	}
	public void setBean_title(String[] bean_title) {
		this.bean_title = bean_title;
	}
	public String[] getBean_time() {
		return bean_time;
	}
	public void setBean_time(String[] bean_time) {
		this.bean_time = bean_time;
	}
	public int getBean_flag() {
		return bean_flag;
	}
	public void setBean_flag(int bean_flag) {
		this.bean_flag = bean_flag;
	}
	
}
